	static class SegmentTree {
		static int[] S, in;
		static int N;

		public SegmentTree(int[] arr) {
			in = arr;
			N = in.length - 1;
			S = new int[N << 1];
			build(1, 1, N);
		}

		static int stat;

		void build(int node, int b, int e) {
			if (b == e) {
				S[node] = in[b];
				stat = 1;
			} else {
				int mid = (b + e) / 2;
				build(node << 1, b, mid);
				build(node << 1 | 1, mid + 1, e);
				if (stat == 1) {
					S[node] = S[node << 1] | S[node << 1 | 1];

				} else {
					S[node] = S[node << 1] ^ S[node << 1 | 1];
				}
				stat = 1 - stat;
			}
		}

		int update(int idx, int val) {
			idx += (N - 1);

			S[idx] = val;
			int stat = 1;
			while (idx > 1) {
				idx >>= 1;
				if (stat == 1) {
					S[idx] = S[idx << 1] | S[idx << 1 | 1];
					stat = 0;
				} else {
					S[idx] = S[idx << 1] ^ S[idx << 1 | 1];
					stat = 1;
				}
			}
			return S[1];
		}

