	public static long fastexpo(long pow)
	{
		long expo = 2;
		long ans = 1;
		while(pow!=0)
		{
			if((pow&1)==1)
			{
				ans = (ans*expo)%mod;
			}
			expo = (expo*expo)%mod;
			pow = pow>>1;
		}
