	}

	static int solve(int[] f, int[] t, int s) {
		int[] maxTimes = new int[s + 1];
		for (int i = 0; i < f.length; i++) {
			maxTimes[f[i]] = Math.max(maxTimes[f[i]], t[i]);
		}

		int time = 0;
		for (int i = s; i > 0; i--) {
			time = Math.max(time, maxTimes[i]);

			time++;
		}
		return time;
	}
