			int a = deq.pollFirst();
			int b = deq.pollFirst();
			repeatAs[i] = a;
			repeatBs[i] = b;
			if (a > b) {
				deq.addFirst(a);
				deq.addLast(b);
			}
			else {
				deq.addFirst(b);
				deq.addLast(a);
			}
		}
		StringBuilder sb = new StringBuilder();
		for (int i = 0; i < q; i++) {
			long query = queries[i] - 1;
			if (query < n-1) {
				sb.append(origAs[(int)query] + " " + origBs[(int)query] + "\n");
			}
			else {
				query %= (n-1);
				sb.append(repeatAs[(int)query] + " " + repeatBs[(int)query] + "\n");
			}
		}
		System.out.println(sb);

	}

