preIndex.data++; 


// All elements with value between minval and val 

// lie in left subtree. 

findPostOrderUtil(pre, n, minval, val, preIndex); 


// All elements with value between val and maxval 

// lie in right subtree. 

findPostOrderUtil(pre, n, val, maxval, preIndex); 


